// src/components/CarCard.js
function CarCard({ image, name, description, onClick }) {
    return (
      <div className="bg-neutralWhite p-4 rounded-lg shadow-md hover:shadow-lg transition-shadow duration-300 cursor-pointer" onClick={onClick}>
        <img src={image} alt={name} className="w-full h-32 object-cover rounded-t-lg" />
        <div className="p-4">
          <h4 className="text-xl font-bold text-darkGray mb-2">{name}</h4>
          <p className="text-mediumGray text-sm">{description}</p>
        </div>
      </div>
    );
  }

  export default CarCard;
